import React, { Component } from 'react';
import Tile from './tile'

export default class Gallery extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="gallery fadeIn">
                {
                    this.props.data.map( data =>
                        <Tile key={data.id}
                              id={data.id}
                              src={data.src}
                              name={data.name}
                              _openImageView={this.props._openImageView} />
                    )
                }
            </div>
        )
    }
}
